import React, { useEffect, useState } from 'react'
import { getJobDetails } from '../api/jobAPI'
import { isAuthenticated } from '../api/userAPI'

const JobDetails = () => {
    let [jobs,setJob]=useState([])
    let {user}=isAuthenticated()
     useEffect(()=>{
      getJobDetails(user._id)
      .then((data)=>{
    if(data.error){
      console.log(data.error)
    
    }
    else{
      setJob(data)
    }
    
      })
     },[])
  return (
    <div>
       <div class="container">
  <h1>Job Postings</h1>
  <table class="table">
    <thead>
      <tr>
        <th>Title</th>
        <th>Location</th>
        <th>Deadline</th>
        <th>Experience</th>
        <th>Education</th>
        <th>Description</th>
      </tr>
    </thead>
    <tbody>
      {jobs&&jobs.map((job)=> (
        <tr>
          <td>{job.title}</td>
          <td>{job.location}</td>
          <td>{job.deadline}</td>
          <td>{job.experience}</td>
          <td>{job.education}</td>
          <td>{job.description}</td>
        </tr>
      ))}
    </tbody>
  </table>
</div>

    </div>
  )
}

export default JobDetails
